import React from "react";
import Card from "./Card";

const cardList = ({ robots }) => {
  const c = robots.map((user, i) => {
    return (
      <Card
        key={robots[i].id}
        id={robots[i].id}
        name={robots[i].name}
        email={robots[i].email}
      />
    );
  });
  return <div>{c}</div>;
};

export default cardList;
